import React, { Component } from 'react';
import { ListItem,ListInfo } from '../style';
class List extends Component{
    render() {
        return (
            <div>
               <ListItem>
               <img src="//upload-images.jianshu.io/upload_images/2796404-2e0dfa5e68996118.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240" alt="120"/>
                <ListInfo>
                    <h3 className='title'>男人离不开的，往往是“不好惹”的女人</h3>
                    <p className='desc'>幸福，大概就是，你想要靠近的那个人，永远都不会推开你。不管他忙与不忙，只要你一回头，就能看见他的样子。 受委屈的时候，他会各种讨好你，遇到麻烦事... </p>
                </ListInfo>
                </ListItem>
               
            </div>
        )
    }
}
export default List;
